import { createAction } from 'typesafe-actions';
import * as eventTypes from './eventTypes';
export const signupRequestedEvent = createAction(eventTypes.USERSECURITY_SIGNUP_REQUESTED, resolve => (firstname, lastname, email, password, join) => resolve({
  firstname,
  lastname,
  email,
  password,
  join
}));
export const signupReceivedEvent = createAction(eventTypes.USERSECURITY_SIGNUP_RECEIVED, resolve => data => resolve(data));
export const signupErroredEvent = createAction(eventTypes.USERSECURITY_SIGNUP_ERRORED, resolve => error => resolve(error));
